package com.shz.workbook.neetcode;

import java.util.HashMap;
import java.util.Map;

/**
 * @author shenazz
 */
public class AnagramChecker2 {

	public static void main(String[] args) {
		String s = "";
		String t = "";

		AnagramChecker2 anagramChecker = new AnagramChecker2();
		boolean anagram = anagramChecker.isAnagram(s, t);
		System.out.println(anagram);

	}

	public boolean isAnagram(String s, String t) {

		if (s == null || t == null || s.length() != t.length()) {
			return false;
		}

		Map<Character, Integer> sCharCounts = new HashMap<>();
		Map<Character, Integer> tCharCounts = new HashMap<>();

		for (int i = 0; i < s.length(); i++) {
			char sChar = s.charAt(i);
			sCharCounts.put(sChar, (sCharCounts.getOrDefault(sChar, 0) + 1));
			char tChar = t.charAt(i);
			tCharCounts.put(tChar, (tCharCounts.getOrDefault(tChar, 0) + 1));
		}

		return sCharCounts.equals(tCharCounts);
	}

}
